bc75-74981f0c755b","subtype":"command","commandType":"auto","position":6.999999910593033,"command":"%md\nFrom the map visualization, we find that there is some correlation between Airline delay fraction and population density. The delayed issue is more obviously in the southwest and northeast. ","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"cfef2668-026d-458f-aaca-d3fe413f30d7"},{"version":"CommandV1","origId":11285,"guid":"e48840f4-4848-401a-9c1b-38f430d6397f","subtype":"command","commandType":"auto","position":6.999999940395355,"command":"%md\nThe above initial exploration of the data shows that the delayed flight dependent on a lot of features such as month, carriers, dept location, and the delayed flights have a skewed distribution. Skewed distributions can cause a problem for some algorithms (e.g, Linear Regression). However, decision tree handles distribution very naturally. The decision tree has a lot of advantages such as it can handle both continuous features (e.g. \"Distance\")  and categorical features (e.g. \"UniqueCarrier\"). However, the decision tree can be extremely sensitive to small perturbations in the data. They can also easily overfit. Random Forests combine many decision trees in order to reduce the risk of overfitting.  ","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":1.457390154243E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputW
